import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Home() {
  return (
    <body>
      <nav class="navbar">
        <div class="col-2 drawer btn">
          <span class="glyphicon glyphicon-menu-hamburger"></span>
        </div>
        <div class="col-2 empty"></div>
        <div class="col-4 homelogo nav1 "> teste</div>
        <div class="col-4 homelogo">Home logo</div>
        <div class="col-4 homelogo nav3 ">teste</div>
        <div class="col-4 empty"></div>
      </nav>
      <div class="container">
        <h1 clas="teste">TESTE!</h1>
      </div>
    </body>
  );
}

export default Home;
